import { Link } from "react-router-dom";

import background from "../assets/bgr1.jpg";
import btn from "../assets/btn1.png";



// Import Swiper styles
import "swiper/css";
import "swiper/css/pagination";
import "swiper/css/navigation";

import {
  FacebookShareButton,
  TwitterShareButton,
  FacebookIcon,
  TwitterIcon,


} from "react-share";


import "./styles.css";
import { Autoplay, Pagination, Navigation } from "swiper";

export default function App() {
  return (
    <>
      <Swiper className="mySwiper" direction={"horizontal"} slidesPerView={1}
      style={
        {
          width: "100%",
          height: 'calc(100vh - 64px)'
        }
      }
      modules={[Mousewheel, Pagination]}
      effect={
        {
          slideShadows: true,
          fadeEffect: {
            crossFade: true
          }
        }
      }
      autoHeight={"true"}
      mousewheel={{ forceToAxis: true, sensitivity: 1, releaseOnEdges: true }}
      pagination={{
        clickable: true,
      }
      }
    >
      {slides.map(slide => 
      <SwiperSlide key={slide.id} 
      style={slide_style}> 
      {slide.Element} 
      </SwiperSlide>)}
    </Swiper>


      {/* social media plugins */}
      <div style={{
        position: 'fixed',
        top: '90%',
        left: '5%',
        transform: 'translate(-50%, -50%)',
        color: 'black',
        fontSize: '50px',
        zIndex: '2',
        opacity: '1.5',
      }}>
        <div className="box">
          {/* facebook share */}
          <FacebookShareButton
            url={"https://www.facebook.com/React-Bootstrap-109811025727740"}
            quote={"React-Bootstrap"}
            hashtag="#reactbootstrap"
          >
            <FacebookIcon size={32} round />
          </FacebookShareButton>
          {/* twitter share */}
          <TwitterShareButton
            url={"https://www.facebook.com/React-Bootstrap-109811025727740"}
            quote={"React-Bootstrap"}
            hashtag="#reactbootstrap"
          >
            <TwitterIcon size={32} round />
          </TwitterShareButton>

        </div>

      </div>

    </>
  );
}
